// src/components/Sidebar.js
import React from "react";
import { Link } from "react-router-dom";
import { List, ListItem, ListItemText, Drawer } from "@mui/material";

const Sidebar = () => {
  return (
    <Drawer
      variant="permanent"
      sx={{
        width: 200,
        flexShrink: 0,
        [`& .MuiDrawer-paper`]: {
          width: 200,
          boxSizing: "border-box",
          borderRadius: "4px", // Optional: Rounded corners
          backgroundColor: "#1d1d1d", // Optional: Background color
          boxShadow: "0px 10px 10px rgba(0, 0, 0, 0.8)", // Add box shadow
        },
      }}
    >
      <List className="sidebar">
        <ListItem button component={Link} to="/">
          <ListItemText primary="Stock Chart" />
        </ListItem>
        <ListItem button component={Link} to="/indicators">
          <ListItemText primary="Stock Indicators" />
        </ListItem>
        <ListItem button component={Link} to="/predictions">
          <ListItemText primary="Stock Predictions" />
        </ListItem>
        <ListItem button component={Link} to="/compare-stocks">
          <ListItemText primary="Compare Stocks" />
        </ListItem>
        <ListItem button component={Link} to="/compare-predictions">
          <ListItemText primary="Compare Predictions" />
        </ListItem>
        <ListItem button component={Link} to="/sentiment">
          <ListItemText primary="Market Sentiment" />
        </ListItem>
        <ListItem button component={Link} to="/learn">
          <ListItemText primary="Learn" />
        </ListItem>
      </List>
    </Drawer>
  );
};

export default Sidebar;
